		{
			float value = inv->getFloatParameter();
			
			setAttackSpeed(value);
			
		}
		break;
	case RPC_SETWOUNDCHANCE__INT_:
		{
			int value = inv->getSignedIntParameter();
			
			setWoundChance(value);
			
		}
		break;
